import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import BookList from './components/BookList';
import './index.css'; // Importa tu archivo de estilos CSS

const App = () => {
  return (
    <Router>
      <div className="app-container"> {/* Clase para contenedor principal */}
        <nav className="app-nav"> {/* Clase para estilos de navegación */}
          <ul>
            <li>
              <a href="/" className="nav-link">Inicio</a> {/* Clase para enlaces de navegación */}
            </li>
            <li>
              <a href="/login" className="nav-link">Login</a>
            </li>
            <li>
              <a href="/books" className="nav-link">Mis Libros</a>
            </li>
          </ul>
        </nav>

        <div className="app-content"> {/* Clase para contenido principal */}
          <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/books" element={<BookList />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
